import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
// import App from './App';
import Card from './Card'
import * as serviceWorker from './serviceWorker';
import { StarPeople, starPeople } from './StarPeople';
import CardList from './CardList';
import 'tachyons';


ReactDOM.render(
                <div>
                    <Card name={starPeople[0].name} height={starPeople[0].height} birth_year={starPeople[0].birth_year} />
                    <Card name={starPeople[1].name} height={starPeople[1].height} birth_year={starPeople[1].birth_year}/>
                    <Card name={starPeople[2].name} height={starPeople[2].height} birth_year={starPeople[2].birth_year}/>
                </div>
, document.getElementById('root'));

// If you want your app to work offline and load faster, you can change
// unregister() to register() below. Note this comes with some pitfalls.
// Learn more about service workers: https://bit.ly/CRA-PWA
serviceWorker.unregister();
